import React from 'react'

const DisplayAnswers = ({question}) => {
  return (
    <div>
      {
          question.answer.map((ans) => (
            <div className="display-ans" key={ans._id}>
              <p>{ans.answerBody}</p>
              <div className=''>

              </div>
            </div>
          ))
      }
    </div>
  )
}

export default DisplayAnswers
